import React, { Component } from 'react';
import './App.css';
import './index.css';
import List from './List'
import Navbartwo from './Navbartwo'
import Footer from './Footer'
import axios from 'axios'


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      pageNo: 1,
      Movies: 24,
      result: [],
      totalResult : 0,
    }
  }

  componentDidMount() {
    axios.get('http://localhost:8080/hulu?language=en&sortby=vote_average DESC&limit=100&offset=1')
      .then(res => {
        console.log(res.data)
        this.setState({
          result : res.data,
          totalResult : res.data.length,
        }
        )
      }
      )
  }
  render() {
    const result = this.state.result;
    return (
      <div style={{ backgroundColor: "#d2d2d275" }}>
        <Navbartwo />
        <List list = {result}/>
        <Footer />
      </div >

    );
  }
}

export default App;
